    }, [theme]);

    return (
        <div className="main-container">
            <nav className="navbar">
                <div className="nav-side">
                    <div className="link-container">
                        <Link to="/">Home</Link>
                    </div>
                </div>
                <div className="nav-side">
                <input
                    className="toggle-btn__input"
                    type="checkbox"
                    name="checkbox"
                    onChange={onThemeChange}
                    checked={theme === 'light'}
                />
                </div>
            </nav>

            <Switch>
                <Route path="/">
                    <Homepage />
                </Route>
            </Switch>
        </div>
    )
}
